import React, { FC } from "react";

import "./input.scss";

interface InputProps {
  value: string;
  placeholder: string;
  onChange: (e: React.ChangeEvent<HTMLInputElement>) => void;
}

const Input: FC<InputProps> = ({ value, placeholder, onChange }) => {
  return (
    <div className="input">
      <input value={value} onChange={onCh} />
    </div>
  );
};

export default Input;
